[{"location":"#SimpleSDMPolygons","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons","text":"","category":"section"},{"location":"#SimpleSDMDatasets.downloader-Union{Tuple{PolygonData{P, D}}, Tuple{D}, Tuple{P}} where {P, D}","page":"SimpleSDMPolygons","title":"SimpleSDMDatasets.downloader","text":"downloader\n\n\n\n\n\n","category":"method"},{"location":"#SimpleSDMDatasets.keychecker-Tuple{P} where P<:PolygonData","page":"SimpleSDMPolygons","title":"SimpleSDMDatasets.keychecker","text":"keychecker\n\n\n\n\n\n","category":"method"},{"location":"#SimpleSDMDatasets.provides-Union{Tuple{D}, Tuple{P}, Tuple{Type{P}, Type{D}}} where {P<:PolygonProvider, D<:PolygonDataset}","page":"SimpleSDMPolygons","title":"SimpleSDMDatasets.provides","text":"provides\n\n\n\n\n\n","category":"method"},{"location":"#SimpleSDMDatasets.resolutions-Tuple{PolygonData}","page":"SimpleSDMPolygons","title":"SimpleSDMDatasets.resolutions","text":"resolutions\n\n\n\n\n\n","category":"method"},{"location":"#SimpleSDMPolygons._extra_keychecks-Union{Tuple{PolygonData{P, D}}, Tuple{D}, Tuple{P}} where {P, D}","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons._extra_keychecks","text":"_extra_keychecks\n\nUsed for checking combinations of keyword arguments. \n\nFor example, for some Countries providers, different countrys have different available levels, and these provider implement this method to check if the requested (country, level) pair is provided. \n\n\n\n\n\n","category":"method"},{"location":"#SimpleSDMPolygons.destination-Union{Tuple{PolygonData{P, D}}, Tuple{D}, Tuple{P}} where {P<:PolygonProvider, D<:PolygonDataset}","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.destination","text":"destination\n\n\n\n\n\n","category":"method"},{"location":"#SimpleSDMPolygons.levels-Tuple{PolygonData}","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.levels","text":"levels\n\n\n\n\n\n","category":"method"},{"location":"#SimpleSDMPolygons.postprocess-Union{Tuple{R}, Tuple{D}, Tuple{P}, Tuple{PolygonData{P, D}, R}} where {P, D, R}","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.postprocess","text":"postprocess\n\n\n\n\n\n","category":"method"},{"location":"#SimpleSDMPolygons.AbstractGeometry","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.AbstractGeometry","text":"AbstractGeometry\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.Bioregions","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.Bioregions","text":"Bioregions\n\nThis is a largest unit than Ecoregions, used by OneEarth\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.Countries","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.Countries","text":"Countries\n\nTo be used when retrieving country borders, although GADM uses it for internal admin areas.\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.EPA","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.EPA","text":"EPA\n\nThis data is all hosted by the US Environmental Protection Agency (EPA), so there's really no guarantee it will stay available day-to-day. \n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.ESRI","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.ESRI","text":"ESRI\n\nDatasets from the ESRI dataset hub - https://hub.arcgis.com/datasets/.\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.Ecoregions","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.Ecoregions","text":"Ecoregions\n\nBoundaries that are defined primarily w.r.t. biotic or environmental characteristics, and that usually span across different administrative boundaries.\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.Feature","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.Feature","text":"Feature\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.FeatureCollection","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.FeatureCollection","text":"FeatureCollection\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.GADM","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.GADM","text":"GADM\n\nKnown for their server's reliable uptime!\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.Lakes","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.Lakes","text":"Lakes\n\nTo be used when retrieving the boundaries of lakes and other similar water bodies.\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.Land","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.Land","text":"Land\n\nTo be used when retrieving land masses, without reference to administrative areas.\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.MultiPolygon","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.MultiPolygon","text":"MultiPolygon\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.NaturalEarth","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.NaturalEarth","text":"NaturalEarth\n\nIt's literally a buncha GeoJSONs in a Github repo\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.Oceans","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.Oceans","text":"Oceans\n\nLike Lakes but not like lakes; lakes with more water and salt.\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.OneEarth","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.OneEarth","text":"OneEarth\n\nEcoregions from https://www.oneearth.org/ - note that this is described as \"bioregions\" by the provider, but is functionally similar to ecoregions. Both BioRegions and EcoRegions work as types.\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.OpenStreetMap","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.OpenStreetMap","text":"OpenStreetMap\n\nThis provider uses the nominatim OSM Germany service to map a user-provided name of any arbitrary place to an OSM ID, then uses the polygon creation service hosted by OSM France to return a GeoJSON file.\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.ParksAndProtected","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.ParksAndProtected","text":"ParksAndProtected\n\nUsed for parks and protected areas, regardless of the jurisdiction that establishes them (municipal, regional, national, etc).\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.Places","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.Places","text":"Places\n\nTo be used when retrieving an arbitrary sized place. This can correspond to very local (smaller admin areas) places, arbitrary locations as with the OSM service, or any other data source where a more focused dataset type does not apply.\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.Polygon","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.Polygon","text":"Polygon\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.PolygonData","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.PolygonData","text":"PolygonData\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.PolygonDataset","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.PolygonDataset","text":"PolygonDataset\n\nThis is an abstract type for all datasets supported by the package.\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.PolygonDownloadType","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.PolygonDownloadType","text":"PolygonDownloadType\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.PolygonFileType","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.PolygonFileType","text":"PolygonFileType\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.PolygonProvider","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.PolygonProvider","text":"PolygonProvider\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons.Resolve","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons.Resolve","text":"Resolve\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons._GeoJSON","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons._GeoJSON","text":"_GeoJSON\n\n\n\n\n\n","category":"type"},{"location":"#SimpleSDMPolygons._Shapefile","page":"SimpleSDMPolygons","title":"SimpleSDMPolygons._Shapefile","text":"_Shapefile\n\n\n\n\n\n","category":"type"}]
